// ==UserScript==
// @name         NodeSeek自动上传到图随行并插入md链接
// @namespace    http://www.swowd.com/
// @version      1.0
// @icon         data:image/x-icon;base64,
// @description  在nodeseek.com的论坛中自动上传图片到图随行并插入Markdown链接
// @author       kele
// @match        https://www.nodeseek.com/*
// @connect      kele.ge
// @grant        GM_xmlhttpRequest
// @grant        GM_setClipboard
// @license      GPL-3.0 License
// @downloadURL https://update.greasyfork.org/scripts/487822/NodeSeek%E8%87%AA%E5%8A%A8%E4%B8%8A%E4%BC%A0%E5%88%B0%E5%9B%BE%E9%9A%8F%E8%A1%8C%E5%B9%B6%E6%8F%92%E5%85%A5md%E9%93%BE%E6%8E%A5.user.js
// @updateURL https://update.greasyfork.org/scripts/487822/NodeSeek%E8%87%AA%E5%8A%A8%E4%B8%8A%E4%BC%A0%E5%88%B0%E5%9B%BE%E9%9A%8F%E8%A1%8C%E5%B9%B6%E6%8F%92%E5%85%A5md%E9%93%BE%E6%8E%A5.meta.js
// ==/UserScript==

(function() {
  'use strict';

  document.addEventListener('paste', handlePaste);

  async function handlePaste(event) {
    const items = (event.clipboardData || event.originalEvent.clipboardData).items;
    let imageFiles = [];

    for (let item of items) {
      if (item.kind === 'file' && item.type.indexOf('image/') !== -1) {
        let blob = item.getAsFile();
        imageFiles.push(blob);
      }
    }

    if (imageFiles.length > 0) {
      event.preventDefault();
      alert('正在上传图片，请稍候...');

      for (let file of imageFiles) {
        let formData = new FormData();
        formData.append('file', file);
        await uploadToImageHost(formData);
      }
    }
  }

  function uploadToImageHost(formData) {
    return new Promise((resolve, reject) => {
      GM_xmlhttpRequest({
        method: 'POST',
        url: 'https://kele.ge/img.php',
        data: formData,
        onload: (response) => {
          let jsonResponse = JSON.parse(response.responseText);

          if (response.status === 200 && jsonResponse && jsonResponse.data) {
            insertToEditor(jsonResponse.data.url);
            alert('图片上传成功，请等待片刻...');
          } else {
            alert('图片获取失败，请联系图随行客服...');
          }

          resolve();
        },
        onerror: (error) => {
          alert('图片上传遇到错误，请检查网络或稍后重试。');
          reject(error);
        }
      });
    });
  }

  function insertToEditor(url) {
    const codeMirrorElement = document.querySelector('.CodeMirror');

    if (codeMirrorElement) {
      const codeMirrorInstance = codeMirrorElement.CodeMirror;

      if (codeMirrorInstance) {
        const cursor = codeMirrorInstance.getCursor();
        let markdownLink = '![](' + url + ')';
        GM_setClipboard(markdownLink);
        codeMirrorInstance.replaceRange(markdownLink + '\n', cursor);
      }
    }
  }
})();
